import{_ as e,c as o,a4 as l,o as r}from"./chunks/framework.CyeRpf1z.js";const p="/reqable/reqable-01.png",i="/reqable/ios/ios-01.png",t="/reqable/ios/ios-02.png",s="/reqable/ios/ios-03.png",d="/reqable/ios/ios-04.png",n="/reqable/ios/ios-05.png",c="/reqable/ios/ios-06.png",m="/reqable/ios/ios-07.png",g="/reqable/ios/ios-08.png",b="/reqable/ios/ios-09.png",_="/reqable/android/android-01.png",q="/reqable/android/android-02.png",h="/reqable/android/android-03.png",y="/reqable/android/android-04.png",u="/reqable/android/android-05.png",z="/reqable/android/android-06.png",f="/reqable/android/android-07.png",k="/reqable/android/android-08.png",P="/reqable/android/android-09.png",R="/reqable/android/android-10.png",v="/reqable/android/android-11.png",x="/reqable/android/android-12.png",S="/reqable/android/android-13.png",T="/reqable/android/android-14.png",A="/reqable/android/android-15.png",N="/reqable/android/android-17.png",C="/reqable/android/android-18.png",w="/reqable/android/android-16.png",$="/reqable/reqable-02.png",j="/reqable/reqable-03.png",B="/reqable/reqable-04.png",D="/reqable/reqable-05.png",W=JSON.parse('{"title":"Reqable抓包工具的使用","description":"","frontmatter":{},"headers":[],"relativePath":"yiov/iPhone/Reqable.md","filePath":"yiov/iPhone/Reqable.md","lastUpdated":1734431113000}'),H={name:"yiov/iPhone/Reqable.md"};function M(O,a,L,V,E,J){return r(),o("div",null,a[0]||(a[0]=[l('<h1 id="reqable抓包工具的使用" tabindex="-1">Reqable抓包工具的使用 <a class="header-anchor" href="#reqable抓包工具的使用" aria-label="Permalink to &quot;Reqable抓包工具的使用&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">(当前界面文档全部来自yiov.top)</p><ul><li><a href="https://yiov.top/" target="_blank" rel="noreferrer">yiov</a>「伊奥&#39;s 教程集」</li></ul></div><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>一款跨平台的HTTP/HTTPS抓包工具，前身是 HttpCanary (小黄鸟)</p><p>官网：<a href="https://reqable.com/zh-CN/" target="_blank" rel="noreferrer">https://reqable.com/zh-CN/</a></p><p>仓库：<a href="https://github.com/reqable/reqable-app" target="_blank" rel="noreferrer">https://github.com/reqable/reqable-app</a></p><p><img src="'+p+'" alt="" loading="lazy"></p><h2 id="安装" tabindex="-1">安装 <a class="header-anchor" href="#安装" aria-label="Permalink to &quot;安装&quot;">​</a></h2><details class="details custom-block"><summary>iOS端安装</summary><p>在 AppStore 搜索下载并安装：<a href="https://apps.apple.com/cn/app/id6473166828" target="_blank" rel="noreferrer">Reqable</a></p><p><img src="'+i+'" alt="" loading="lazy"></p><p>这里我不用电脑，就选择 <code>独立模式</code>，进入界面后点左上角三横 <code>≡</code></p><p><img src="'+t+'" alt="" loading="lazy"></p><p>证书管理 - 安装根证书到手机</p><p><img src="'+s+'" alt="" loading="lazy"></p><p>按照教程，点击 <code>下载</code> ，完成</p><p><img src="'+d+'" alt="" loading="lazy"></p><p>跳转到Safari浏览器，下载描述文件</p><p><img src="'+n+'" alt="" loading="lazy"></p><p>设置 - 已下载描述文件 - 安装</p><p><img src="'+c+'" alt="" loading="lazy"></p><p>显示已验证就是安装完成了</p><p><img src="'+m+'" alt="" loading="lazy"></p><p>设置 - 通用 - 关于本机 - 证书信任设置</p><p><img src="'+g+'" alt="" loading="lazy"></p><p>打开 <code>Reqbale</code> 信任开关即可，回到Reqbale就能看到证书已安装</p><p><img src="'+b+'" alt="" loading="lazy"></p></details><details class="details custom-block"><summary>Android端安装</summary><p>手机打开 <a href="https://reqable.com/zh-CN/" target="_blank" rel="noreferrer">官网</a> ，下载客户端，我这里选择v8版</p><details class="details custom-block"><summary>不知道下载哪个？</summary><ul><li><p>universal：64/32位手机通用版</p></li><li><p>arm64-v8a：64位处理器，常见于市面主流手机</p></li><li><p>armeabi-v7a：32位处理器，常见于老旧款手机</p></li><li><p>x86_64：64位处理器，常见于平板</p></li><li><p>x86：32位处理器，常见于平板和模拟器</p></li></ul></details><p><img src="'+_+'" alt="" loading="lazy"></p><p>下载完成后，我选择 <code>独立模式</code> ，需要电脑一起使用请选择协同模式</p><p><img src="'+q+'" alt="" loading="lazy"></p><p>进入APP提示需要安装Reqable辅助服务，点查看，下载</p><p><img src="'+h+'" alt="" loading="lazy"></p><p>完成后会提示下载目录，一般默认 <code>Download - Reqable</code></p><p><img src="'+y+'" alt="" loading="lazy"></p><p>安装辅助服务后打开</p><p><img src="'+u+'" alt="" loading="lazy"></p><p>提示准备就绪即可，然后再Reqable上打开辅助开关</p><p><img src="'+z+'" alt="" loading="lazy"></p><p>为了避免辅助服务掉后台，我们需要开启自启动</p><p>长按辅助服务图标 - 应用信息 - 打开自启动开关</p><p><img src="'+f+'" alt="" loading="lazy"></p><p>最后安装证书，左上角三横 <code>≡</code> - 证书管理 - 安装根证书到手机</p><p><img src="'+k+'" alt="" loading="lazy"></p><p>我使用 <code>Root设备</code> 演示，点击证书，完成下载即可，一会要用到</p><details class="details custom-block"><summary>非root设备怎么安装</summary><p>点击非Root设备标签，按照官方的安装教程来就行了</p></details><p><img src="'+P+'" alt="" loading="lazy"></p><p>下载 <a href="https://mt2.cn/" target="_blank" rel="noreferrer">MT管理器</a> ，安装并打开，点击右侧根目录中的 <code>etc</code></p><details class="details custom-block"><summary>MT管理器需要root后使用吗</summary><p>如果移动文件出现挂载失败，就需要！</p><p>我是使用的小米开发版，然后用 <a href="https://dzp.lanzouj.com/ioB9Npn6xtg" target="_blank" rel="noreferrer">Syslock解锁分区</a> 即可</p><p><img src="'+R+'" alt="" loading="lazy"></p><p><img src="'+v+'" alt="" loading="lazy"></p></details><details class="details custom-block"><summary>MT目录简单解读</summary><ul><li><p>左侧：默认为内部存储 (也可在左侧菜单栏切换)</p></li><li><p>右侧：默认为根目录，即系统目录 (也可在左侧菜单栏切换)</p></li></ul></details><p><img src="'+x+'" alt="" loading="lazy"></p><p>然后分别进入<code>Security - cacerts</code> 目录</p><p><img src="'+S+'" alt="" loading="lazy"></p><p>右侧就停在这里页面，然后点击左侧内部存储找到 <code>Download</code> 文件夹进入</p><p><img src="'+T+'" alt="" loading="lazy"></p><p>在 <code>Reqable</code> 文件夹找到刚才下载的证书，长按 <code>复制</code> 到右侧</p><p><img src="'+A+'" alt="" loading="lazy"></p><p>确定就完成证书安装了，Reqable应用证书界面就看到是已经安装好了</p><details class="details custom-block"><summary>手机设备上如何查看证书是否已经安装</summary><p>设置 - 安全 - 更多安全设置 - 加密与凭据</p><p><img src="'+N+'" alt="" loading="lazy"></p><p>信任与凭据，在系统标签中 个人和工作有 <code>Reqable LLC</code> 即可</p><p><img src="'+C+'" alt="" loading="lazy"></p></details><p><img src="'+w+'" alt="" loading="lazy"></p></details><h2 id="使用" tabindex="-1">使用 <a class="header-anchor" href="#使用" aria-label="Permalink to &quot;使用&quot;">​</a></h2><p>我们要抓某个APP的数据，先点击开始抓包，然后再进APP操作，抓到后点停止</p><p>演示：抓取 <code>滴滴果园token</code> (苹果和安卓方法一致)</p><hr><p>点击开始抓包，提示开启VPN，确定</p><p><img src="'+$+'" alt="" loading="lazy"></p><p>进入滴滴APP - 免费领水果，浇一次水</p><p><img src="'+j+'" alt="" loading="lazy"></p><p>返回Reqable停止抓包，右上角 <code>…</code> - 按域名分组</p><p>点开 <code>game.xiaojikeji.com</code></p><p><img src="'+B+'" alt="" loading="lazy"></p><p>在其中一个POST结果中进去，请求体里找到 <code>toekn</code> 值</p><p><img src="'+D+'" alt="" loading="lazy"></p><h2 id="特别鸣谢" tabindex="-1">特别鸣谢 <a class="header-anchor" href="#特别鸣谢" aria-label="Permalink to &quot;特别鸣谢&quot;">​</a></h2><ul><li><a href="https://mp.weixin.qq.com/s/iAuW6if4o_P9wfR1h2pfeg" target="_blank" rel="noreferrer">京小辅</a>「京东ck_安卓端」</li></ul>',25)]))}const F=e(H,[["render",M]]);export{W as __pageData,F as default};
